import React from "react";
import "./Dashboard.css";

function Dashboard(props) {
  props.setIsexpanded(!props.isExpanded);
  return (
    <div className="dashboard">
      
      <main className="main-content"style={props.isExpanded ? { width: '6rem' } : { width: '1.5rem' }}>
        <h1>Dashboard</h1>
        <div className="dashboard-section" style={{ backgroundColor: '#ffe066' }}>
          <h3>Total Courses</h3>
          <p>07</p>
        </div>
        <div className="dashboard-section" style={{ backgroundColor: '#ff6666' }}>
          <h3>Attendance</h3>
          <p>60%</p>
          <p style={{ color: '#ff9999' }}>24% Absent</p>
        </div>
        <div className="dashboard-section">
          <h3>Past Classes</h3>
          <div className="class-item" style={{ backgroundColor: '#ccffcc' }}>
            <p>Differential Equations-1</p>
            <p>MA 102N/MA 104N</p>
          </div>
        </div>
      </main>
    </div>
  );
}

export default Dashboard;
